import React, {useState} from 'react';
import '../assets/css/footer.css';

const Footer = () => {
    return (
        <footer class="footer" id="index-footer">
            <div class="row">
                <div class="col-12 first allrights" id="site">
                    <strong>Joseph Bautista		|  	 Â© 2018 - 2023		|  	  All rights reserved </strong>
                    <p>
                        <a href="https://web.facebook.com/jayrbautista26" target="_blank"><i class="fab fa-facebook icon-soc"></i></a>

                        <a href="https://twitter.com/jayrbautista26" target="_blank"><i class="fab fa-twitter icon-soc"></i></a>

                        <a href="mailto:josephreuben.bautista@gmail.com" target="_blank"><i class="fas fa-envelope"></i></a>

                        <a href="https://www.instagram.com/jayrbautista26/" target="_blank"><i class="fab fa-instagram icon-soc"></i></a>

                        <a href="https://www.youtube.com/user/jayrbautista26" target="_blank"><i class="fab fa-youtube icon-soc"></i></a>

                        <a href="https://www.linkedin.com/in/joseph-reuben-bautista-a946a7123/" target="_blank"><i class="fab fa-linkedin icon-soc"></i></a>

                        <a href="https://github.com/joseph-bautista" target="_blank"><i class="fab fa-github icon-soc"></i></a>

                        {/* <a href="https://gitlab.com/josephreuben.bautista" target="_blank"><i class="fab fa-gitlab icon-soc"></i></a>  */}
                    </p>
                </div>


            </div>
        </footer>
    );
};

export default Footer;
